// export default Menu

import React, { useState } from 'react';
import Khmer_flag from '../img/khmerFlag.png';
import English_flag from '../img/englishFlag.png';

const Menu = () => {
  const [language, setLanguage] = useState('en'); // Default language is English

  const handleLanguageSwitch = (lang) => {
    setLanguage(lang);
    console.log(`Language switched to: ${lang}`);
    // Additional logic to update language across the application can be added here
  };

  return (
    <div>
      {/* <!-- Offcanvas Menu Begin --> */}
      <div className="offcanvas-menu-overlay"></div>
      <div className="offcanvas-menu-wrapper">
        <div className="offcanvas__option">
          <div className="offcanvas__links">
            <a href="#">Sign in</a>
            <a href="#">FAQs</a>
          </div>
          <div className="header__top__hover">
            <span>
              Language <i className="arrow_carrot-down"></i>
            </span>
            <ul style={{ width: '120px' }}>
              <li
                onClick={() => handleLanguageSwitch('en')}
                style={{ display: 'flex', alignItems: 'center', cursor: 'pointer' }}
              >
                <img
                  src={English_flag}
                  alt="English Flag"
                  style={{ width: '30px', height: '30px', marginRight: '10px' }}
                />
                English
              </li>
              <li
                onClick={() => handleLanguageSwitch('kh')}
                style={{ display: 'flex', alignItems: 'center', cursor: 'pointer' }}
              >
                <img
                  src={Khmer_flag}
                  alt="Khmer Flag"
                  style={{ width: '30px', height: '30px', marginRight: '10px' }}
                />
                Khmer
              </li>
            </ul>
          </div>
        </div>
        <div className="offcanvas__nav__option">
          <a href="#" className="search-switch">
            <img src="img/icon/search.png" alt="Search Icon" />
          </a>
          <a href="#">
            <img src="img/icon/heart.png" alt="Heart Icon" />
          </a>
          <a href="#">
            <img src="img/icon/cart.png" alt="Cart Icon" /> <span>0</span>
          </a>
          <div className="price">$0.00</div>
        </div>
        <div id="mobile-menu-wrap"></div>
        <div className="offcanvas__text">
          <p>Let's Go to shipping now for return or refund guarantee.</p>
        </div>
      </div>
      {/* <!-- Offcanvas Menu End --> */}
    </div>
  );
};

export default Menu;
